import React, { useState } from 'react';
import AdminNavbar from './adminnavbar';

function CustomersBar({ handleCustomersClick }) {
  return (
    <div>
      <h3>Customers</h3>
      <button onClick={handleCustomersClick}>View Customer Details</button>
    </div>
  );
}

function BooksBar({ handleBooksClick }) {
  return (
    <div>
      <h3>Books</h3>
      <button onClick={handleBooksClick}>View Book Details</button>
    </div>
  );
}

function CustomerDetails({ handleBack }) {
  return (
    <div>
      <h2>Customer Details</h2>
      {/* Display customer details here */}
      <button onClick={handleBack}>Back to Status</button>
    </div>
  );
}

function BookDetails({ handleBack }) {
  return (
    <div>
      <h2>Book Details</h2>
      {/* Display book details here */}
      <button onClick={handleBack}>Back to Status</button>
    </div>
  );
}

function VSComponent() {
  const [showCustomersDetails, setShowCustomersDetails] = useState(false);
  const [showBooksDetails, setShowBooksDetails] = useState(false);

  const handleCustomersClick = () => {
    setShowCustomersDetails(true);
    setShowBooksDetails(false);
  };

  const handleBooksClick = () => {
    setShowBooksDetails(true);
    setShowCustomersDetails(false);
  };

  const handleBack = () => {
    setShowCustomersDetails(false);
    setShowBooksDetails(false);
  };

  return (
    <div>
      <AdminNavbar />
      <h1>Status</h1>
      {!showCustomersDetails && !showBooksDetails && (
        <div>
          <CustomersBar handleCustomersClick={handleCustomersClick} />
          <BooksBar handleBooksClick={handleBooksClick} />
        </div>
      )}
      {showCustomersDetails && <CustomerDetails handleBack={handleBack} />}
      {showBooksDetails && <BookDetails handleBack={handleBack} />}
    </div>
  );
}

export default VSComponent;
